import React from 'react';
//import OurNavBar from './OurNavBar'
import logo from './logo.svg';
import './App.css';
import Iframe from 'react-iframe'

function App() {
  return (
    <div className="App">
      <header className="App-header">


      </header>

      <Iframe class="airtable-embed" src="https://airtable.com/embed/shrYHEJU5lTBOA7rk?backgroundColor=orange&layout=card&viewControls=on"
      frameborder="0" onmousewheel="" width="50%" height="533" style="background: transparent; border: 1px solid #ccc;"></Iframe>

    </div>
  );
}

export default App;
